import {useEffect, useState} from "react";
import {useNavigate, useParams} from "react-router-dom";
import {addEmployee, getById, updateEmployee} from "./api";

const EditEmployee=() => {
    const [fname, setFName] = useState("");
    const [lname, setLName] = useState("");
    const [dob, setDob] = useState("");
    const [desig, setDesig] = useState("");
    const [email, setEmail] = useState("");
    const [doj, setDoj] = useState("");
    const [dept, setDept] = useState("");

    const navigate = useNavigate();
    const params=useParams();

    useEffect(() => {
        return async ()=>{
         const result= await getById(params.id);
         console.log(result)
         setFName(result.fname);
         setLName(result.lname);
         setDob(result.dob);
         setDept(result.dept);
         setEmail(result.email);
         setDoj(result.doj);
         setDesig(result.desig);
        }
    }, []);

    const onFirstNameChange = (e) => {
        setFName(e.target.value);
    };
    const onLastNameChange = (e) => {
        setLName(e.target.value);
    };
    const onDeptChange = (e) => {
        setName(e.target.value);
    };
    const onDesigChange = (e) => {
        setDesig(e.target.value);
    };
    const onEmailChange = (e) => {
        setEmail(e.target.value);
    };
    const onDojChange = (e) => {
        setDoj(e.target.value);
    };
    const onDobChange = (e) => {
        setDob(e.target.value);
    };

    const handleUpdateEmployee = async (e) => {
        e.preventDefault();
        const employee = {
            fname,
            lname,
            dept,
            desig,
            email,
            doj,
            dob,
        };
        await updateEmployee(params.id,employee)
        navigate("/list");
    };

    return (
        <div className="container">
            <h3 className="text-success">Update Employee</h3>
            <form className="col-4" onSubmit={handleUpdateEmployee}>
                <div className="form-group">
                    <label className="form-label">First Name</label>
                    <input type="text" className="form-control" onChange={onFirstNameChange} value={fname} />
                </div>
                <div className="form-group">
                    <label className="form-label">Last Name</label>
                    <input type="text" className="form-control" onChange={onLastNameChange} value={lname} />
                </div>
                <div className="form-group">
                    <label className="form-label">Department</label>
                    <input type="text" className="form-control" onChange={onDeptChange} value={dept} />
                </div>
                <div className="form-group">
                    <label className="form-label">Designation</label>
                    <input
                        type="text"
                        className="form-control"
                        onChange={onDesigChange} value={desig}
                    />
                </div>
                <div className="form-group">
                    <label className="form-label">Email Id</label>
                    <input
                        type="email"
                        className="form-control"
                        onChange={onEmailChange} value={email}
                    />
                </div>
                <div className="form-group">
                    <label className="form-label">Date Of Joining</label>
                    <input type="date" className="form-control" onChange={onDojChange}  value={doj}/>
                </div>
                <div className="form-group">
                    <label className="form-label">Date Of Birth</label>
                    <input type="date" className="form-control" onChange={onDobChange}  value={dob}/>
                </div>
                <br />
                <button className="btn btn-success">Update Employee</button>
            </form>
        </div>
    );
};

export default EditEmployee;
